import React, { handleChange, useEffect, useState } from "react";
import { InputGroup, Form, Modal, Button } from "react-bootstrap";

function ManufacturerModal() {
  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
    <button type="button" class="btn btn-outline-secondary btn-sm px-4" onClick={handleShow}>Pokreni konfigurator</button>

      <Modal show={show} onHide={handleClose} backdrop="static" keyboard={false}>
        <Modal.Header closeButton>
          <Modal.Title>Konfigurator servisa</Modal.Title>
        </Modal.Header>
        <Modal.Body>
        <Form>
  <Form.Check type="radio" label="Peugeot" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Volkswagen" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Citroen" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Audi" name="group2" id="radio1"/>
  <Form.Check type="radio" label="BMW" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Seat" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Alfa Romeo" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Kia" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Hyundai" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Honda" name="group2" id="radio1"/>
  <Form.Check type="radio" label="Toyota" name="group2" id="radio1"/>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>Next</Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default ManufacturerModal;
